import { TabMenu } from "primereact/tabmenu";

const Navbar = () => {
  const items: object[] = [
    { label: "Main", icon: "pi pi-fw pi-home" },
    { label: "Quests", icon: "pi pi-fw pi-calendar" },
    { label: "Locations", icon: "pi pi-fw pi-pencil" },
    { label: "NPC's", icon: "pi pi-fw pi-file" },
    { label: "Items", icon: "pi pi-fw pi-cog" },
  ];

  return (
    <>
      <TabMenu model={items} />
    </>
  );
};

export default Navbar;
